"""
Algorithms
1.	Give an example of each algorithm with an explanation of the runtime.
a.	Linear search
b.	Binary search
c.	Bubble sort
d.	Insertion sort
e.	Selection sort

Extra Credit:
f.	Merge sort
"""

"""
1.
Linear search - Goes through each element and checks if it matches

Best Case, element at start: O(1)
Average Case, element in middle: O(n/2)
Worst Case, element at end: O(n)

Binary Search
Get middle element, if number to find is greater than middle element, it is in right half, 
otherwise it is in left half. Continue to do this.

Best Case, element is at middle: 0(1)
Average Case, keeps halving: 0(log n)
Worst Case, keeps halving: 0(log n)

Bubble sort
Goes through list, swaps elements if next element is less than current element. Continues to do 
this until one whole pass is done without making any changes to the list.

Best Case Time Complexity, array is already sorted: O(n)
Worst and Average Case Time Complexity, array is reverse sorted: O(n*n).

Insertion sort
Goes through, if it finds an unsorted item, it keeps on moving it forward until it is sorted

Best Case Time Complexity, array is already sorted: O(n)
Worst and Average Case Time Complexity, array is reverse sorted: O(n*n).

Selection Sort
Find minimum element and place at beginning - continue to do this until sorted

Time Complexity, there are 2 nested loops: O(n**2)

Merge Sort
Continue to split list until it is only 1 is left, then starts merging them back together in order

Best, Average, and Worst: O(n*Log n)
"""

