# b.	Binary search

def binary_search(list, element):
    if len(list) <= 2:
        return -1
    middle_index = int(len(list)/2)-1
    if list[middle_index] != element:
        if element < list[middle_index]:
            return binary_search(list[:middle_index], element)
        ans = binary_search(list[middle_index:], element)
        if ans != -1:
            return middle_index+ans
        return ans
    return middle_index

