# c.	Bubble sort

def bubble_sort(list):
    isSorted = True
    copyList = list.copy()
    for index in range(0, len(copyList)-1):
        if copyList[index] > copyList[index+1]:
            isSorted = False
            copyList[index], copyList[index+1] = copyList[index+1], copyList[index]
    if not isSorted:
        return bubble_sort(copyList)
    return copyList

