# d.	Insertion sort

def insertion_sort(list):
    copyList = list.copy()
    for index in range(1, len(copyList)):
        if copyList[index] < copyList[index-1]:
            for i in range(index-1, -1, -1):
                if copyList[i] > copyList[i+1]:
                    copyList[i], copyList[i+1] = copyList[i+1], copyList[i]
    return copyList

