# e.	Selection sort

def selection_sort(list):
    copyList = list.copy()
    for index in range(len(copyList)):
        min_index = index
        for index2 in range(index, len(copyList)):
            if copyList[index2] < copyList[min_index]:
                min_index = index2
        copyList[min_index], copyList[index] = copyList[index], copyList[min_index]
    return copyList

